#include <bits/stdc++.h>

using namespace std;

#ifdef LOCAL
#include "algo/debug.h"
#else
#define debug(...) 42
#endif

const int dx[4] = {1, 0, -1, 0};
const int dy[4] = {0, 1, 0, -1};
const string let = "DRUL";

int main(int argc, char** argv) {
  if (argc < 2) {
    cerr << "usage: test [test_id]" << '\n';
    return 0;
  }
  int test_id = atoi(argv[1]);
  ios::sync_with_stdio(false);
  cin.tie(0);
  ifstream in(string("lambdaman") + char('0' + test_id / 10) + char('0' + test_id % 10) + ".in");
  vector<string> grid;
  string foo;
  while (in >> foo) {
    grid.push_back(foo);
  }
  int h = int(grid.size());
  int w = int(grid[0].size());
  int li = -1, lj = -1;
  for (int i = 0; i < h; i++) {
    for (int j = 0; j < w; j++) {
      if (grid[i][j] == 'L') {
        li = i, lj = j;
      }
    }
  }
  int si = li, sj = lj;
  grid[li][lj] = '!';
  string s;
  if (test_id == 11)
    s = "";
  if (test_id == 12)
    s = "";
  if (test_id == 13)
    s = "";
  if (test_id == 14)
    s = "";
  if (test_id == 15)
    s = "";
  for (char c : s) {
    int dir = int(let.find(c));
    li += dx[dir];
    lj += dy[dir];
    if (grid[li][lj] == '#') {
      // assert(false);
      li -= dx[dir];
      lj -= dy[dir];
      continue;
    }
    assert(grid[li][lj] != '#');
    grid[li][lj] = '!';
  }
  for (int i = 0; i < h; i++) {
    for (int j = 0; j < w; j++) {
      assert(grid[i][j] != '.');
    }
  }
  debug("ok");
  li = si;
  lj = sj;
  string t = "";
  for (int i = 0; i < int(s.size()); i += 2) {
    int dir = int(let.find(s[i]));
    li += 2 * dx[dir];
    lj += 2 * dy[dir];
    assert(0 <= li && li < h && 0 <= lj && lj < w);
    if (s.substr(i, 2) == "DD") {
      t += s.substr(i, 2);
      t += "LL";
      if (s.substr(i + 2, 2) == "LL") {
        lj -= 2;
        i += 2;
      } else {
        if (grid[li][lj - 1] != '#') {
          t += "RLRR";
        }
      }
    } else
    if (s.substr(i, 2) == "UU") {
      t += s.substr(i, 2);
      t += "RR";
      if (s.substr(i + 2, 2) == "RR") {
        lj += 2;
        i += 2;
      } else {
        if (grid[li][lj + 1] != '#') {
          t += "LRLL";
        }
      }
    } else {
      t += s[i] + string("") + let[dir ^ 2] + s.substr(i, 2);
    }
  }
  debug(s.size(), t.size() / 2);
  {
    for (int i = 0; i < h; i++) {
      for (int j = 0; j < w; j++) {
        if (grid[i][j] == '!') {
          grid[i][j] = '.';
        }
      }
    }
    li = si;
    lj = sj;
    grid[li][lj] = '!';
    for (char c : t) {
      int dir = int(let.find(c));
      li += dx[dir];
      lj += dy[dir];
      if (grid[li][lj] == '#') {
        li -= dx[dir];
        lj -= dy[dir];
        continue;
      }
      grid[li][lj] = '!';
    }
    for (int i = 0; i < h; i++) {
      for (int j = 0; j < w; j++) {
        assert(grid[i][j] != '.');
      }
    }
  }
  string res = t;
  debug("hi", res);
  vector<int> num = {1};
  int shift = 1;
  if (11 <= test_id && test_id <= 15) shift = 4;
  for (int id = int(res.size()) - shift; id >= 0; id -= shift) {
    char c = res[id];
    int val = int(let.find(c));
    int carry = val;
    for (int i = 0; i < int(num.size()); i++) {
      num[i] = num[i] * 4 + carry;
      carry = num[i] / 94;
      num[i] %= 94;
    }
    while (carry > 0) {
      num.push_back(carry % 94);
      carry /= 94;
    }
    // if (c == 'L' && id + shift < int(res.size()) && res[id + shift] == 'D') {
    //   id += shift;
    // } else {
    //   res[id + shift] = 
    // }
  }
  ofstream out(string("") + char('0' + test_id / 10) + char('0' + test_id % 10) + ".new");
  string encoder = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789!\"#$%&'()*+,-./:;<=>?@[\\]^_`|~ \n";
  string ans = "";
  for (int i = int(num.size()) - 1; i >= 0; i--) {
    ans += char(33 + num[i]);
  }
  string encoded_test_id = "";
  int tmp = test_id;
  while (tmp > 0) {
    encoded_test_id += char(33 + int(encoder.find(char('0' + tmp % 10))));
    tmp /= 10;
  }
  out << test_id << '\n';
  out << encoded_test_id << '\n';
  reverse(encoded_test_id.begin(), encoded_test_id.end());
  string final = "";
  if (11 <= test_id && test_id <= 15) {
    final += "B. S3/,6%},!-\"$!-!." + encoded_test_id + "} B$ B$ L\" B$ L# B$ v\" B$ v# v# L# B$ v\" B$ v# v# L\" L# ? B= v# I\" S B. BT I% BD B* I% B% v# I% S>>FFLFLLOOLLFLFF B$ v\" B/ v# I% U# S";
  } else {
    final += "B. S3/,6%},!-\"$!-!." + encoded_test_id + "} B$ B$ L\" B$ L# B$ v\" B$ v# v# L# B$ v\" B$ v# v# L\" L# ? B= v# I\" S B. BT I\" BD B% v# I% S>LOF B$ v\" B/ v# I% U# S";
  }
  final += ans;
  debug(final.size());
  out << final << '\n';
  return 0;
}
